import React from 'react';

class Home extends React.Component {
  render() {
    return (
      <div>
        <h1>Examples:</h1>
        <a href="/mapKey">
          <button>MapKey</button>
        </a>
        <a href="/functionalComponent">
          <button>Functional Component</button>
        </a>
      </div>
    );
  }
}

export default Home;
